"use strict";(function(){const cancelSubscription=document.querySelector(".cancel-subscription");if(cancelSubscription){cancelSubscription.onclick=function(){Swal.fire({text:"Are you sure you would like to cancel your subscription?",icon:"warning",showCancelButton:true,confirmButtonText:"Yes",customClass:{confirmButton:"btn btn-primary me-2 waves-effect waves-light",cancelButton:"btn btn-outline-secondary waves-effect"},buttonsStyling:false}).then(function(result){if(result.value){Swal.fire({icon:"success",title:"Unsubscribed!",text:"Your subscription cancelled successfully.",customClass:{confirmButton:"btn btn-success waves-effect"}})}else if(result.dismiss===Swal.DismissReason.cancel){Swal.fire({title:"Cancelled",text:"Unsubscription Cancelled!!",icon:"error",customClass:{confirmButton:"btn btn-success waves-effect"}})}})}}const addressEdit=document.querySelector(".edit-address"),addressTitle=document.querySelector(".address-title"),addressSubTitle=document.querySelector(".address-subtitle");addressEdit.onclick=function(){addressTitle.innerHTML="Edit Address";addressSubTitle.innerHTML="Edit your current address"}})();